        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](10, "The Kruger National Park is South Africa's oldest and largest national park, covering almost 2 million hectares along the country's northeastern border. Kruger has a diverse history of management plans, from intensive to adaptive; as well as a geographical gradient of rainfall, geology, elevation, temperature, and soil compositions across the park. As such, Kruger is ideal for studying the effects of global temperature change, rainfall variability, drought frequency, and management (of fires, water sources, and herbivore populations) on a diverse ecosystem driven by both top-down and bottom-up processes.\n");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](11, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](12, "\nIn particular, I am interested in the perennial problem of rare antelope. Kruger's water management strategy, along with a series of devastating droughts, has severely impacted the distribution and number of rare antelope (Hippotragus equinus; H. niger; Taurotragus oryx; Damaliscus lunatus) throughout the park. As well as impacting the ecology of the park, these antelopes' contributions to biodiversity are one of the large tourist draws of the park. With this project, I hope to assess species grouping patterns through the use of a ");
