        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](27, " From the summer of 2015 until the spring of 2017, I had the pleasure of working on a population dynamics research project with Drs. Leah Shaw and Junping Shi of the William & Mary mathematics department. I started with an established system of two coupled logistic equations undergoing dispersal, which modeled the dynamics of a marine population (inspired by Chesapeake Bay oysters), and was given free reign to explore the dynamics. From there, I uncovered a rich dynamical architecture, and created diagrams exploring its steady-state and bifurcation structure in a qualitative fashion. Currently, the paper is in preparation to be put forward for peer-review.\n");
