        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](28, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](29, "i");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](30, "my contribution:");
