        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](31, " The abstract, literature review, non-dimensionalization of the model in Section 2; Lyapunov proof in Section 3; and all results, diagrams, and analyses were authored by myself with guidance from my advisors. The general model presented in Section 2 was devised by Leah Shaw and Junping Shi, and proofs from Section 3, Theorem 2 until the end of that section were constructed by Junping Shi.\n\u200B");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
