        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](35, " \"Aquatic currents often create unequal patterns of dispersal from one population of organisms to another. We study two population patches coupled by this asymmetric dispersal, with population conserved during migration. In addition, our coupled patches are subject to the positively density-dependent Allee effect: Initial populations below an inherent threshold decline towards extinction, while those above the threshold persist towards their carrying capacity. Analytically, we show that there are no periodic orbits, find a perpetually locally stable equilibrium at the extinction state (0,0), and define parameter ranges within which positive equilibria must occur. Numerically, we explore one- and two-dimensional steady-state bifurcation structures, varying dispersal rates and the Allee threshold. At high Allee thresholds, we uncover large parameter ranges in which the extinction state is the only fixed point. These regions have not been shown to occur with asymmetric dispersal rates with no mortality during migration; we therefore focus on the bifurcations that lead to this surprising extinction state. It is crucial to understand this behavior in efforts to restore endangered species that exhibit an Allee effect and asymmetric dispersal.\"\n");
