        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](47, " As a final project for a mathematical modeling course I took in 2016, my partner Ellen Nguyen and I chose to study the dynamics of the well-known FitzHugh-Nagumo model of neurons and action potentials. We derived the model and studied its phase portrait and the Hopf bifurcation that occurs at certain values of the incoming voltage into the neuron. We also discussed the biological relevancy of these Hopf bifurcations and examined the activity of coupled neurons using a modifed FitzHugh-Nagumo model.\n");
