        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](60, " In the summer of 2016, I was afforded an incredible opportunity to study abroad for 6 weeks in St. Petersburg, Russia. While there, I conducted an interview with local resident Ekaterina Lebedeva for the ");
